import React from 'react';
import { Box, Typography, Paper } from '@mui/material';

function Body() {
  return (
    <Box
      sx={{
        flex: 1,
        p: 3,
        backgroundColor: '#3e2723', // Background color for the Body
        minHeight: '100vh', // Ensure it spans the viewport height
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
      }}
    >
      <Paper
        sx={{
          p: 3,
          elevation: 3,
          backgroundColor: '#5d4037', // Optional: Slightly lighter background for the Paper
          color: '#ffffff', // White text for readability
          maxWidth: '00px', // Restrict width for better layout
        }}
      >
        <Typography variant="h4" gutterBottom>
          Welcome to the Stunning Layout!
        </Typography>
        <Typography variant="body1">
          This is your main content area, styled with MUI's Paper component for a professional look.
        </Typography>
      </Paper>
    </Box>
  );
}

export default Body;
